import React from 'react';
import logo from './logo.svg';
import './App.css';
import GoogleMap from 'google-map-react';

function App() {
  return (
    <div className="App">
      <h1> Abode </h1>
      <GoogleMap
        apiKey={"AIzaSyBlE7GymtUyLM97k2QlT1lPUJCYU_1GHd4"}
        center={[59.938043, 30.337157]}
        zoom={9}>
      </GoogleMap>
    </div>
  );
}

export default App;
